import React from 'react';
import Modal from '../../../../../components/Modal';

interface IModalProps {
  isOpen: boolean;
  setIsOpen: () => void;
  handleUpdateUser: () => void;
}

export const ModalEditUser: React.FC<IModalProps> = ({
  setIsOpen,
  isOpen,
  children,
  handleUpdateUser,
}) => {
  return (
    <Modal setIsOpen={setIsOpen} isOpen={isOpen}>
      {children}
    </Modal>
  );
};
